    const userList = [
        new User('Pedro','Rodriguez','disconnected'),
        new User('Carlos','Perez','Connected'),
        new User('Ana','López','disconnected'),

    ];
    
    console.log(userList);


    return (
        <div>
            <table className=''>
                <thead>
                    <tr>
                    <th>Nombre</th>
                    <th>Apellido</th>
                    <th>Status</th>
                    <th></th>
                    </tr>
                </thead>
                <tbody>
                    {/* <tr>
                    <td>carmen</td>
                    <td>lopez</td>
                    <td>conectada</td>
                    <td>button</td>
                    </tr> */}

                </tbody>
            </table>
        </div>
    );
};


ContactList.propTypes = {

};


export default ContactList;
